        private static readonly ConcurrentDictionary<string, WorkEligibilityDocumentValue> _values =
            new ConcurrentDictionary<string, WorkEligibilityDocumentValue>(_knownValues);

        private WorkEligibilityDocumentValue(string value)
        {
            if (value == null) throw new ArgumentNullException(nameof(value));
            Value = value;
        }

        public string Value { get; }

        public static WorkEligibilityDocumentValue Of(string value)
        {
            return _values.GetOrAdd(value, _ => new WorkEligibilityDocumentValue(value));
        }

        public static implicit operator WorkEligibilityDocumentValue(string value) => Of(value);
        public static implicit operator string(WorkEligibilityDocumentValue workeligibilitydocumentvalue) => workeligibilitydocumentvalue.Value;

        public static WorkEligibilityDocumentValue[] Values()
        {
            return _values.Values.ToArray();
        }

        public override string ToString() => Value.ToString();

        public bool IsKnown()
        {
            return _knownValues.ContainsKey(Value);
        }

        public override bool Equals(object? obj) => Equals(obj as WorkEligibilityDocumentValue);

        public bool Equals(WorkEligibilityDocumentValue? other)
        {
            if (ReferenceEquals(this, other)) return true;
            if (other is null) return false;
            return string.Equals(Value, other.Value);
        }

        public override int GetHashCode() => Value.GetHashCode();
    }

